description:
Speech female sound from the ASPMA Course Peer Assesment 7 (Part 1). Original sound used from <a href="http://freesound.org/people/xserra/sounds/317745/." rel="nofollow">http://freesound.org/people/xserra/sounds/317745/.</a> This sound is the stochastic component of the HPS model analysis using sms-tools.

The parameters used in the analysis were: 

Window-type = Hamming; 
Window-size = 1297; 
FFT-size = 2048; 
Magnitude-threshold = -90; 
Minimum-duration-of-harmonic-tracks = 0.1; 
Maximum-number-of-harmonics = 45; 
Minimum-fundamental-frequency = 100; 
Maximum-fundamental-frequency = 300; 
Maximum-error-in-f0-detection-algorithm = 5; 
Max-frequency-deviation-in-harmonic-tracks = 0.01; 
Stochastic approximation-factor = 0.1;

